ople think focus means saying yes to the thing youve got to focus on. But thats not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. Im actually as proud of the things we havent done as the things I have done. Innovation is saying no to 1,000 things.</blockquote>\n<cite>Steve Jobs</cite>  Apple Worldwide Developers Conference, 1997\n<h2>TABLES</h2>\n<table>\n<thead>\n<tr>\n<th>Employee</th>\n<th>Salary</th>\n<th></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<th><a href=\"http://example.org/\">John Doe</a></th>\n<td>$1</td>\n<td>Because thats all Steve Jobs needed for a salary.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Doe</a></th>\n<td>$100K</td>\n<td>For all the blogging she does.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Fred Bloggs</a></th>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Bloggs</a></th>\n<td>$100B</td>\n<td>With hair like that?! Enough said</td>\n</tr>\n</tbody>\n</table>\n<h2>DEFINITION LISTS</h2>\n<dl>\n 	<dt>Definition List Title</dt>\n 	<dd>Definition list division.</dd>\n 	<dt>Startup</dt>\n 	<dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd>\n 	<dt>#dowork</dt>\n 	<dd>Coined by Rob Dyrdek and his personal body guard Christopher Big Black Boykins, Do Work works as a self motivator, to motivating your friends.</dd>\n 	<dt>Do It Live</dt>\n 	<dd>Ill let Bill OReilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd>\n</dl>\n<h2>UNORDERED LISTS (NESTED)</h2>\n<ul>\n 	<li>List item one\n<ul>\n 	<li>List item one\n<ul>\n 	<li>List item one</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n<h2>ORDERED LIST (NESTED)</h2>\n<ol>\n 	<li>List item one\n<ol>\n 	<li>List item one\n<ol>\n 	<li>List item one</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n<h2>HTML TAGS</h2>\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title=\"Apple\" href=\"http://apple.com/\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for seriously.\n\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for for the win.\n\n<strong>Big Tag(<em>deprecated in HTML5</em>)</strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\nCode is poetry. <cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n<pre>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n	and here\'s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\n}</pre>\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers</q> Steve Ballmer\n\n<strong>Strike Tag(<em>deprecated in HTML5</em>)</strong>\n\nThis tag shows strike-through text\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold text.</strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the 2 down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newtons E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag(<em>deprecated in HTML5</em>)</strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.','Typography','','trash','closed','closed','','typography__trashed','','','2017-09-03 10:56:28','2017-09-03 10:56:28','',0,'http://dine.withemes.com/?page_id=2',0,'page','',0),(481,1,'2017-02-20 03:10:30','2017-02-20 03:10:30','[vc_row css=\".vc_custom_1488104419112{padding-bottom: 80px !important;}\"][vc_column][dine_gallery images=\"351,361,356\"][opentable title=\"Make a reservation\"][/vc_column][/vc_row][vc_row full_width=\"stretch_row\" parallax=\"true\" elements_fade=\"true\" css=\".vc_custom_1489434113238{padding-top: 180px !important;padding-bottom: 180px !important;background: #111111 url(http://boscolytham.co.uk/wp-content/uploads/2017/02/ready.jpg?id=351);background-position: center;background-repeat: no-repeat !important;background-size: cover !important;}\" overlay=\"rgba(0,0,0,0.3)\"][vc_column][text_slider text=\"Or Call us: 1-222-5555\" animation=\"bo